metadata.content:
Sentry Middleware
Installation
TypeScript (v3.0.0+) Python (v0.3.0+)
Install the
[```
@inngest/middleware-sentry
```](https://www.npmjs.com/package/@inngest/middleware-sentry)
[package](https://www.npmjs.com/package/@inngest/middleware-sentry)
and configure it as follows:
Copy Copied
```
import * as Sentry from "@sentry/node" ;
import { Inngest } from "inngest" ;
import { sentryMiddleware } from "@inngest/middleware-sentry" ;

// Initialize Sentry as usual wherever is appropriate
Sentry .init ( ... );

const inngest = new Inngest ({
id : "my-app" ,
middleware : [ sentryMiddleware ()] ,
});
```
Requires inngest@>=3.0.0 and @sentry/*@>=8.0.0`.
